import React from 'react';

interface IProps {
    message: string
}

let ErrorMessage: React.FC<IProps> = ({message}) => {
    return (
        <>
            <div className="container mt-3">
                <div className="row">
                    <div className="col text-center">
                        <div>
                            <p className="h5 text-danger">{message}</p>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
};
export default ErrorMessage;
